	return function(answer) {
      return answer.field.id === questionID;
    }
}

function getAnswer(answerType) {
  switch (answerType) {
        case 'choices':
        	return function(answer) {
                  return answer.choices.labels;
            }
       case 'choice':
        	return function(answer) {
